Given the complexity of the query and the need for specific relationships (e.g., Rapper as a professional, writer as a musical artist), a SPARQL query would look something like this:

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbpedia: <http://dbpedia.org/ontology/>

SELECT ?producer 
WHERE {
  ?work a dbpedia:MusicalWork, dbpedia:Song ;
           dbpedia:associatedMusicArtist [ a dbpedia:MusicalArtist; rdfs:label "Rapper" ] ;
           dbpedia:writer [ a dbpedia:MusicalArtist; rdfs:label "Writer" ] .
  ?work dbpedia:producer ?producer .
  ?artist a dbpedia:Musician, dbpedia:Artist ;
           dbpedia:associatedWithWork ?work ;
           rdfs:label "40 Dayz & 40 Nightz"@en .
  ?artist a dbpedia:Professional .
}
```

